import {Carousel} from "antd";

const contentStyle = {
  height: "200px",
  color: "#fff",
  lineHeight: "200px",
  textAlign: "center",
  background: "#364d79",
};

const CarouselComponent = () => (
  <>
    <Carousel dotWidth="4" dotHeight="4" className="h-full">
      <div>
        <h3 style={contentStyle}>
          <img
            src="https://static.vecteezy.com/system/resources/thumbnails/036/135/738/small_2x/ai-generated-colored-water-drops-on-abstract-background-water-drops-on-colorful-background-colored-wallpaper-ultra-hd-colorful-wallpaper-background-with-colored-bubbles-photo.jpg"
            alt=""
          />
        </h3>
      </div>
      <div>
        <h3 style={contentStyle}>
          <img
            className="h-full w-full"
            src="data:image/jpeg;base64,"
            alt=""
          />
        </h3>
      </div>
      <div>
        <h3 style={contentStyle}>
          <img
            className="h-full w-full"
            src="data:image/jpeg;base64,"
            alt=""
          />
        </h3>
      </div>
    </Carousel>
    <div className="flex justify-center p-2">
      <button className="py-2 px-4 bg-blue-500 text-white rounded ">Click Me</button>
    </div>
  </>
);

export default CarouselComponent;
